- Neues Design des App und verbesserte Möglichkeiten;
- Hinzugefügte Technologie " VPN on Demand ";
- Es wurde ein neuer Abschnitt mit detaillierten Informationen zu Ihrem  Benutzerkonto (es zeigt den Status, Dauer und Bandbreite);
- Jetzt kann man nicht nur leicht den Freunden über Faceless.Me mit der bestimmten Schaltfläche im sozialen Netzwerke erzählen, sondern auch den App im App Store bewerten.
